#!/usr/bin/env python# -*- coding:utf-8 -*-# @Time : 2025/7/2# @Author : cyq# @File : playConfigMapper# @Software: PyCharm# @Desc:from typing import List, Dictfrom app.mapper import Mapperfrom app.model import async_sessionfrom app.model.playUI import PlayConfig, PlayCaseVariables, PlayMethodfrom sqlalchemy import insertclass PlayMethodMapper(Mapper):    __model__ = PlayMethod    @classmethod    async def init_play_methods(cls, methods: List[Dict[str, str]]):        try:            async with async_session() as session:                await session.execute(                    insert(cls.__model__).values(methods)                )                await session.commit()        except Exception as e:            raise eclass PlayCaseVariablesMapper(Mapper):    __model__ = PlayCaseVariablesclass PlayConfigMapper(Mapper):    __model__ = PlayConfig